using Petbook.Controllers;
using Microsoft.VisualStudio.TestTools.UnitTesting;
using Petbook.Data;
using Petbook.Models;
using EntityFrameworkCore.Testing.Moq;
using Microsoft.AspNetCore.Identity;
using Moq;
using Microsoft.AspNetCore.Http;
using Microsoft.AspNetCore.Mvc.ViewFeatures;
using Microsoft.AspNetCore.Mvc;
using Assert = Microsoft.VisualStudio.TestTools.UnitTesting.Assert;
using System.Security.Claims;

namespace Petbook.Controllers.Tests
{
    [TestClass()]
    public class PetsControllerTests
    {
        private static PetsController controller;
        private static ApplicationDbContext db;

        [TestInitialize]
        public void SetUp()
        {
            db = GetDbContext();
            controller = GetInstanceController();
        }
        public PetsController GetInstanceController()
        {
            if (controller == null)
            {
                controller = GetController();
            }
            return controller;
        }

        public ApplicationDbContext GetDbContext()
        {
            if (db == null)
            {
                // create a mock db with 10 users and 20 pets
                db = Create.MockedDbContextFor<ApplicationDbContext>();
                db.PopulateDb(10);
            }
            return db;
        }
 
        private PetsController GetController()
        {   
            // create a mock admin user
            var user = new ClaimsPrincipal(new ClaimsIdentity(new Claim[] {
                new Claim(ClaimTypes.NameIdentifier, "admin"),
                new Claim(ClaimTypes.Name, "admin@admin.com"),
                new Claim(ClaimTypes.Role, "Admin")
            }, "TestAuthentication"));
            // create a mock controller with a session variable
            var httpContext = new DefaultHttpContext { User = user };
            var tempData = new TempDataDictionary(httpContext, Mock.Of<ITempDataProvider>());
            tempData["SessionVariable"] = "admin";
            var userStore = new Mock<IUserStore<ApplicationUser>>();
            var roleStore = new Mock<IRoleStore<IdentityRole>>();
            var userManager = new Mock<UserManager<ApplicationUser>>(userStore.Object, null, null, null, null, null, null, null, null);
            var roleManager = new Mock<RoleManager<IdentityRole>>(roleStore.Object, null, null, null, null);
            var controller = new PetsController(db, userManager.Object, roleManager.Object) { TempData = tempData };
            controller.ControllerContext = new ControllerContext();
            controller.ControllerContext.HttpContext = httpContext;
            return controller;
        }

        [TestMethod()]
        public void IndexTest()
        {

            var result = controller.Index() as ViewResult;

            Assert.IsNotNull(result);

            // Assert that all the pets are loaded in the Pets ViewBag
            List<Pet> list = (List<Pet>)result.ViewData["Pets"];
            Assert.AreEqual(20, list.Count); // 20 because in mock data we have num=10 and pets have num*2
        }

        [TestMethod()]
        public void ShowTest()
        {
            var mockPets = db.pets;

            foreach (var pet in mockPets)
            {
                var result = controller.Show((pet as Pet).PetId) as ViewResult;

                Assert.IsNotNull(result);

                var returnedPet = (Pet)result.ViewData.Model;

                // Assert that the correct pet is retrieved
                Assert.AreEqual((pet as Pet).PetId, returnedPet.PetId);
                Assert.AreEqual((pet as Pet).PetName, returnedPet.PetName);
                Assert.AreEqual((pet as Pet).PetPhoto, returnedPet.PetPhoto);
                Assert.AreEqual((pet as Pet).Category, returnedPet.Category);
                Assert.AreEqual((pet as Pet).Description, returnedPet.Description);
                Assert.AreEqual((pet as Pet).Location, returnedPet.Location);
                Assert.AreEqual((pet as Pet).Posts, returnedPet.Posts);

                // Check the user who owns the pet is loaded in the ViewBag
                String userId = (String)result.ViewData["UserCurent"];
                Assert.AreEqual(userId, (pet as Pet).UserId);
            }
        }

        [TestMethod()]
        public void NewTest()
        {
            // Create a new pet
            var newPet = new Pet
            {
                PetName = "Test Pet",
                Category = "Dog",
                Description = "Description",
                Location = "Location",
                UserId = "8e445865-a24d-4543-a6c6-9443d048cdb0", // admin user
                PetPhoto = "data:image/png;base64,"
            };

            // Get all pets before adding the new one
            var result = controller.Index() as ViewResult;
            List<Pet> pets = (List<Pet>)result.ViewData["Pets"];
            Assert.AreEqual(20, pets.Count); // 20 because in mock data we have num=10 and pets have num*2

            // Add the new pet
            result = controller.New(newPet) as ViewResult;

            // Get all pets after adding the new one
            result = controller.Index() as ViewResult;
            pets = (List<Pet>)result.ViewData["Pets"];
            Assert.AreEqual(21, pets.Count); // 21 because in mock data we have 20 pets and we added another one
        }

        [TestMethod()]
        public void EditTest()
        {
            // Get all pets from db
            var mockPets = db.pets;

            // Select a pet id to be edited
            var existingPetId = (mockPets[0] as Pet).PetId;

            // Create a new pet object to represent the edited pet
            var editedPet = new Pet
            {
                PetId = existingPetId,
                PetName = "Edited Pet",
                Category = "Edited Dog",
                Description = "Edited Description",
                Location = "Edited Location",
                UserId = "8e445865-a24d-4543-a6c6-9443d048cdb0", // admin user
                PetPhoto = "data:image/png;base64,"
            };

            // Edit the selected pet
            controller.Edit(existingPetId, editedPet);

            // Get the edited pet 
            var result = controller.Show(existingPetId) as ViewResult;
            var updatedPet = (Pet)result.ViewData.Model;

            // Check the selected pet was edited
            Assert.AreEqual(editedPet.PetId, updatedPet.PetId);
            Assert.AreEqual(editedPet.PetName, updatedPet.PetName);
            Assert.AreEqual(editedPet.PetPhoto, updatedPet.PetPhoto);
            Assert.AreEqual(editedPet.Category, updatedPet.Category);
            Assert.AreEqual(editedPet.Description, updatedPet.Description);
            Assert.AreEqual(editedPet.Location, updatedPet.Location);
        }

        [TestMethod()]
        public void DeleteTest()
        {
            // Get all pets from db
            var mockPets = db.pets;

            // Select a pet id to be deleted
            var existingPetId = (mockPets[0] as Pet).PetId;

            // Delete the selected pet
            controller.Delete(existingPetId);

            // Assert that the pet has been deleted from the database
            // by searching through all existing pets
            var result = controller.Index() as ViewResult;
            List<Pet> pets = (List<Pet>)result.ViewData["Pets"];
            foreach(var pet in pets)
            {
                Assert.AreNotEqual(pet.PetId, existingPetId);
            }

        }
    }
}